import React from "react";
import logo from "../images/logo.png";
import banner from "../images/banner.png";

const landingPage = () => {
  return (
    <div>
      <div>
        <img src={logo} alt="" />
        <img src={banner} alt="" />
      </div>
    </div>
  );
};

export default landingPage;
